function removeBotaoAtivo(){var e=document.querySelectorAll("[data-tab-link]");for(let t=0;t<e.length;t++)e[t].classList.remove("navbar__link--is--active")}document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll("[data-tab-link]");for(let t=0;t<e.length;t++)e[t].addEventListener("click",function(t){removeBotaoAtivo(),t.target.classList.add("navbar__link--is--active")})});